Adventure Time Fionna and Cake #1

FANFAVORITE ADVENTURE TIME SENSATIONS FIONNA AND CAKE ARRIVE TO THE HIT ADVENTURE TIME COMIC!

Join Cake the Cat and Fionna the Human in this totally algebraic new adventure, written and drawn by FIONNA AND CAKE creator and ADVENTURE TIME storyboard artist Natasha Allegri!

When Fionna rescues a feral flame boy from a pack of wild fire lions, it starts her on a quest shell never forget.Don't miss out on this sure to be INSANELY popular new ADVENTURE TIME mini series! 

